import "./Loader.css";
const Loader = () => {
  return (
    <div className="main-logo-loader">
      <div className="logo-stick top"></div>
      <div className="logo-stick right"></div>
      <div className="logo-stick bottom"></div>
      <div className="logo-stick left"></div>
    </div>
  );
};

export { Loader };
